import PropTypes from 'prop-types'

const SettingsButton = ({ color, text, onClick, id}) => {

    return (
        <div>
            <button
            onClick={() => onClick(id)} 
            style={{ backgroundColor: color }} 
            className='sbtn'>
                {text}
            </button>
        </div>
    )
}

// TaskbarButton.defaultProps = {
